import React , {useState, useEffect} from 'react';
import axios from 'axios';

function Gallery(props){

    const [artpieces, setArtpieces] = useState()

    useEffect(()=> {
        axios.get('http://localhost:5000/artpieces/')
        .then(response => {
            setArtpieces(response.data)
        })
        .catch((error) => {
          console.log(error);
        })   
    },[])

    const allArtpieces = artpieces.map(item => {
        <img src={item.uri} alt="artpiece"></img>
    })


    return (
        <div>
            <h1> gallery </h1>
            <div className ="canvasImgArray">
                {allArtpieces}
            </div>   
            <button onClick={console.log(artpieces)}> console </button>
        </div>

    )
}

export default Gallery
